import { LinkContainer } from "react-router-bootstrap";
import "./footer.css";
export default function Footer() {
  return (
    <footer className="bg-dark text-light d-flex align-items-center w-100">
      <div>
        <h3>Dental Clark</h3>
      </div>
      <div className="d-flex"></div>
    </footer>
  );
}
